import React, { useState, useEffect } from "react";
import { motion } from "framer-motion";
import Charts from "../components/Charts";
import "../styles/styles.css";

const Dashboard = () => {
  console.log("‚úÖ Dashboard component loaded successfully!");

  // üìä State Management
  const [timeRange, setTimeRange] = useState("24h");
  const [filteredData, setFilteredData] = useState([]);
  const [notebookOutputs, setNotebookOutputs] = useState([]);
  const [stats, setStats] = useState({
    healthyNodes: 12,
    issuesDetected: 0,
    pendingFixes: 0,
    anomalies: 0,
  });

  // üéØ Fetch Notebook Output from Flask API
  useEffect(() => {
    const fetchNotebookOutput = async () => {
      try {
        const response = await fetch("http://127.0.0.1:5000/get-notebook-output");

        if (!response.ok) {
          throw new Error(`HTTP error! Status: ${response.status}`);
        }

        const data = await response.json();
        console.log("üìú Notebook Output Fetched:", data.outputs);

        // ‚úÖ Process data into structured format
        const parsedData = data.outputs.map((output) => parseNotebookOutput(output));
        setNotebookOutputs(parsedData);

        // ‚úÖ Update Stats (Cards)
        updateStats(parsedData);
      } catch (error) {
        console.error("‚ùå Error fetching notebook output:", error);
      }
    };

    fetchNotebookOutput();
    const interval = setInterval(fetchNotebookOutput, 5000); // Auto-refresh every 5s

    return () => clearInterval(interval);
  }, []);

  // üìä Function to Extract Data from Notebook Output
  const parseNotebookOutput = (output) => {
    const lines = output.split("\n");

    const epochLossMatch = lines.find((line) => line.includes("Loss:"));
    const detectedIssueMatch = lines.find((line) => line.includes("Detected Issue:"));
    const probabilityMatch = lines.find((line) => line.includes("Probability:"));

    return {
      timestamp: new Date().toLocaleString(),
      eventMessage: epochLossMatch || "No training data",
      podStatus: detectedIssueMatch ? "Warning" : "Normal",
      cpuUsage: Math.floor(Math.random() * 100),
      memoryUsage: Math.floor(Math.random() * 1000),
      predictedIssue: detectedIssueMatch || "No issue detected",
      confidence: probabilityMatch ? probabilityMatch.split(":")[1].trim() : "N/A",
    };
  };

  // üìä Function to Update Card Stats Dynamically
  const updateStats = (parsedData) => {
    const newIssues = parsedData.filter((entry) => entry.predictedIssue !== "No issue detected").length;
    const newAnomalies = parsedData.filter((entry) => entry.predictedIssue === "Anomaly").length;

    setStats({
      healthyNodes: Math.max(12 - newIssues, 5),
      issuesDetected: newIssues,
      pendingFixes: Math.max(newIssues - newAnomalies, 0),
      anomalies: newAnomalies,
    });
  };

  return (
    <div className="container p-6">
      <motion.h1
        className="text-4xl font-bold text-center text-white mb-6"
        initial={{ opacity: 0, y: -20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5 }}
      >
        üöÄ Kubernetes Issue Predictor
      </motion.h1>
      <motion.p
        className="text-center text-xl text-gray-300 mb-8"
        initial={{ opacity: 0, y: -20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.6 }}
      >
        üìä Monitor & predict issues before they escalate.
      </motion.p>

      {/* ‚è≥ Time Range Selector */}
      <motion.div
        className="flex justify-center mb-8"
        initial={{ opacity: 0, y: -20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.7 }}
      >
        <label className="filter-label text-white mr-4">üìÖ Select Time Range:</label>
        <select
          className="filter-dropdown p-2 rounded-md border-2 border-indigo-600"
          value={timeRange}
          onChange={(e) => setTimeRange(e.target.value)}
        >
          <option value="24h">üïí Last 24 Hours</option>
          <option value="7d">üìÜ Last 7 Days</option>
          <option value="30d">üìÖ Last 30 Days</option>
        </select>
      </motion.div>

      {/* üéØ Key Metrics Cards (Updated) */}
      <motion.div
        className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6 mb-8"
        initial={{ opacity: 0, y: -20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
      >
        <div className="card healthy bg-green-500 p-6 rounded-lg shadow-lg text-white text-center">
          <h3 className="text-2xl font-semibold">üü¢ Healthy Nodes</h3>
          <p className="text-4xl">{stats.healthyNodes}</p>
        </div>
        <div className="card issues bg-yellow-500 p-6 rounded-lg shadow-lg text-white text-center">
          <h3 className="text-2xl font-semibold">‚ö†Ô∏è Issues Detected</h3>
          <p className="text-4xl">{stats.issuesDetected}</p>
        </div>
        <div className="card pending bg-blue-500 p-6 rounded-lg shadow-lg text-white text-center">
          <h3 className="text-2xl font-semibold">üîÑ Pending Fixes</h3>
          <p className="text-4xl">{stats.pendingFixes}</p>
        </div>
        <div className="card anomalies bg-red-500 p-6 rounded-lg shadow-lg text-white text-center">
          <h3 className="text-2xl font-semibold">üö® Anomalies</h3>
          <p className="text-4xl">{stats.anomalies}</p>
        </div>
      </motion.div>

      {/* üìä Chart Display */}
      <Charts chartData={filteredData} />

      {/* üî• Recent Issues & Notebook Output Table */}
      <motion.div
        className="mt-8"
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.9 }}
      >
        <h2 className="text-3xl font-semibold mb-4">üõë Recent Issues & Notebook Output</h2>
        <table className="issues-table w-full table-auto border-collapse">
          <thead>
            <tr className="bg-indigo-600 text-white">
              <th className="p-3">üìÖ Timestamp</th>
              <th className="p-3">üì¢ Event Message</th>
              <th className="p-3">üìä Pod Status</th>
              <th className="p-3">‚ö° CPU Usage</th>
              <th className="p-3">üíæ Memory Usage</th>
              <th className="p-3">üö® Predicted Issue</th>
              <th className="p-3">‚úÖ Confidence (%)</th>
            </tr>
          </thead>
          <tbody>
            {notebookOutputs.length > 0 ? (
              notebookOutputs.map((entry, index) => (
                <tr key={index} className="border-b border-gray-300">
                  <td className="p-3">{entry.timestamp}</td>
                  <td className="p-3">
                    <pre style={{ whiteSpace: "pre-wrap", wordBreak: "break-word" }}>
                      {entry.eventMessage}
                    </pre>
                  </td>
                  <td className="p-3">{entry.podStatus}</td>
                  <td className="p-3">{entry.cpuUsage} %</td>
                  <td className="p-3">{entry.memoryUsage} MB</td>
                  <td className="p-3">{entry.predictedIssue}</td>
                  <td className="p-3">{entry.confidence}</td>
                </tr>
              ))
            ) : (
              <tr>
                <td colSpan="7" className="text-center p-3">No output available</td>
              </tr>
            )}
          </tbody>
        </table>
      </motion.div>
    </div>
  );
};

export default Dashboard;
